import Card from '../components/Card';

const ReadCharacters = (props) => {

    const [Characters, setCharacters] = useState([]);

    useEffect(() => {
        setCharacters(props.data);
    }, [props]);

    return (
        <div className="ReadCharacters">
            {
                Characters && Characters.length > 0 ?
                Characters.map((post,index) => 
                   <Card id={post.id} name={post.name} class={post.class} description={post.description}/>
                ) : <h2>{'No Challenges Yet ðŸ˜ž'}</h2>
            }
        </div>  
    )
}

export default ReadCharacters;
